This is an application that will take images from attachment and make a gallery out of them.
{{velocity}}
{{html clean="false"}}<link href="https://cdnjs.cloudflare.com/ajax/libs/lightgallery/1.6.12/css/lightgallery.min.css" rel="stylesheet" type="text/css" />
<div id="lightgallery">
#foreach ($attachment in $doc.getAttachmentList())
  <a class="image" style="width:200px" href="$doc.getAttachmentURL($attachment.getFilename())">
    <img src="$doc.getAttachmentURL($attachment.getFilename())" />
  </a>
#end
</div>
<script src="https://cdnjs.cloudflare.com/ajax/libs/lightgallery/1.6.12/js/lightgallery.min.js" type="text/javascript"></script>
<script type="text/javascript">
  document.getElementsByClassName('image')[0].onclick = function(e){
  e.preventDefault();
    console.log('Image clicked');
  }
  lightGallery(document.getElementById('lightgallery'));
</script>
{{/html}}
{{/velocity}}
